Director: Rob Marshall
Writers: James Lapine (screenplay), James Lapine (musical)
Stars: Anna Kendrick, Meryl Streep, Chris Pine 
Genres: Adventure | Comedy | Fantasy | Musical
Country: USA
Language: English

